--/*
--##########################################
--## FIN Configuraciones a rellenar
--##########################################
--*/

 V_TMP_TPE T_TPE;
 BEGIN

 FOR I IN V_TPE.FIRST .. V_TPE.LAST
 
 LOOP
 
V_TMP_TPE := V_TPE(I);

 -- CREA UNA SECUENCIA PARA COMPARA EL DD_TPE_CODIGO
 V_EXIST:= 0;
 SELECT COUNT (*) INTO V_EXIST
 FROM DD_TPE_TIPO_PROD_ENTIDAD
 WHERE DD_TPE_CODIGO = ''||V_TMP_TPE(1);
 
 -- CREA UNA CONDICION PARA EL VALOR ALMACENADO EN LA POSICION 12 (DD_TPE_ACTIVO)
 V_ACTIVO:= 0;
 IF V_TMP_TPE(12) = 'ACTIVO' THEN
 V_ACTIVO := '1';
 ELSE
 V_ACTIVO := '0';
 END IF;
 
 -- COMPARA LA SECUENCIA CON EL DD_TPR_CODIGO 
 -- SI EXISTE UPDATEA ESTOS CAMPOS
  IF V_EXIST = 1 THEN
  DBMS_OUTPUT.PUT_LINE('Updateando '||TABLA||': '||V_TMP_TPE(1));
  
    V_MSQL:= 'UPDATE ' ||V_ESQUEMA|| '.'||TABLA||' 
    SET DD_TPE_DESCRIPCION = '''||V_TMP_TPE(2)||''', 
    DD_TPE_DESCRIPCION_LARGA = '''||V_TMP_TPE(3)||''', 
    USUARIOMODIFICAR = '''||V_TMP_TPE(7)||''', 
    FECHAMODIFICAR = '||V_TMP_TPE(8)||', 
    DD_TPE_ACTIVO = '||V_ACTIVO||'
    WHERE DD_TPE_CODIGO = '''||V_TMP_TPE(1)||'''';

--DBMS_OUTPUT.PUT_LINE(V_MSQL);
  EXECUTE IMMEDIATE V_MSQL;
  
 -- SI NO EXIXTE NO HACE NADA EN LA TABLA
 ELSE 

 DBMS_OUTPUT.PUT_LINE('NO ENCONTRADO');
 
  END IF;
   END LOOP; 
   V_TMP_TPE := NULL; 

 COMMIT;

 --FIN DEL PROGRAMA PRINCIPAL
 --EXCEPCIONES

 EXCEPTION

 WHEN OTHERS THEN  
   err_num := SQLCODE;
   err_msg := SQLERRM;

   DBMS_OUTPUT.put_line('Error:'||TO_CHAR(err_num));
   DBMS_OUTPUT.put_line(err_msg);
  
   ROLLBACK;
   RAISE;
 END;
  /
 EXIT;
